import React, {Component} from 'react';
import '../../App.css';
//import axios from 'axios';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class BuyerProfile extends Component {


    render() {

        return(
            <div class="container">
                <div class="col-md-4">
                <h3>Your Account</h3><br/>
                <h5><a>Profile Picture</a></h5>
                <h5><a>Profile</a></h5>
                <h5><a>Phone</a></h5>
                </div>

                <div class="col-md-8 profile-div">
                <div><h4>Your Account</h4><br/>
                <h5>Name</h5>
                </div>

                <div>
                <h5>Email</h5>
                </div>
                <div>
                <h5>Password</h5>
                </div>
                </div>

            </div>
        )
    }
}

export default BuyerProfile;
